<script>
export default {
  data() {
    return {
      animeOn: false,
      isSleeping: false
    }
  },
  computed: {
    salemSrc() {
      return this.isSleeping ? 'Salem--sleep.svg' : 'Salem.svg';
    },
    salemAlt() {
      return this.isSleeping ? 
        'There\'s a black cat under a bed. It seems to be sleeping, but he\'s just ignoring you.' : 
        'There\'s a black cat curling itself for a nap.';
    }
  },
  mounted() {
    if (!this.checkIfSalemIsSleeping()) {
      this.setSalemSleeping();
      this.runSleepAnime();
    }
  },
  methods: {
    runSleepAnime() {
      setTimeout(() => {
        this.animeOn = true;
      }, 3000);
    },
    checkIfSalemIsSleeping() {
      this.isSleeping = localStorage && localStorage.getItem('salem');
      return this.isSleeping;
    },
    setSalemSleeping() {
      localStorage.setItem('salem', 'sleep')
    }
  }
}
</script>

